export default function LoginStack(props) {
  return (
    <Stack.Navigator mode="card" headerMode="none" >
      <Stack.Screen
        name="Login"
        component={Login}
        option={{
          headerShown: false,
          headerTransparent: true
        }}
      />
      <Stack.Screen
        name="ForgetPassword"
        component={ForgetPassword}
        option={{
          headerTransparent: true
        }}
      />
      <Stack.Screen
        name="SignUp"
        component={SignUp}
        option={{
          headerTransparent: true
        }}
      />
      <Stack.Screen
        name="VerifyOtp"
        component={VerifyOtp}
        option={{
          headerTransparent: true
        }}
      />
      <Stack.Screen
        name="Main"
        component={Main}
        option={{
          headerTransparent: true
        }}
      />
      <Stack.Screen
        name="ServiceDetail"
        component={ServiceDetail}
        option={{
          headerTransparent: true
        }}
      />
      <Stack.Screen
        name="SelectService"
        component={SelectService}
        option={{
          headerTransparent: true
        }}
      />
      
      <Stack.Screen
        name="DentalClinicServicesDetails"
        component={DentalClinicServicesDetails}
        option={{
          headerTransparent: true
        }}
      />
      {/* <Stack.Screen
        name="PaymentActivity1"
        component={PaymentActivity1}
        option={{
          headerTransparent: true
        }}
      />
       */}
       
      <Stack.Screen name="ServiceDetailGetAppointmentStack" component={ServiceDetailGetAppointmentStack} />
